// src/components/OrdemServicoEditar.js
import React, { useState, useEffect } from 'react';

const OrdemServicoEditar = ({ match }) => {
  const [ordem, setOrdem] = useState({
    id: '',
    numero_protocolo: '',
    nome_solicitante: '',
    telefone_solicitante: '',
    data_abertura: '',
    data_agendamento: '',
    descricao_servico: '',
    tipo_visita: '',
    modalidade: '',
    nome_empresa: '',
    endereco: '',
    problema_reportado: '',
    nome_tecnico: '',
    status: '',
  });

  const ordemId = match.params.id;

  useEffect(() => {
    // Simulando a obtenção de dados da ordem de serviço para edição
    // Aqui você deve fazer uma requisição ao back-end para obter os dados da ordem específica
    const ordemEdicao = {
      id: ordemId,
      numero_protocolo: 'PROTOCOLO123',
      nome_solicitante: 'João Silva',
      telefone_solicitante: '11987654321',
      data_abertura: '2025-05-05',
      data_agendamento: '2025-05-10',
      descricao_servico: 'Substituição da fonte de alimentação',
      tipo_visita: 'Técnico',
      modalidade: 'Presencial',
      nome_empresa: 'Hospital Santa Clara',
      endereco: 'Rua A, 123',
      problema_reportado: 'Equipamento não liga',
      nome_tecnico: 'Carlos Souza',
      status: 'Aguardando Atendimento',
    };
    setOrdem(ordemEdicao);
  }, [ordemId]);

  const handleChange = (e) => {
    setOrdem({
      ...ordem,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aqui você deve enviar os dados para o back-end e salvar a edição da ordem
    console.log('Ordem editada:', ordem);
    alert('Ordem de serviço editada com sucesso!');
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Editar Ordem de Serviço</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Protocolo:</label>
          <input
            type="text"
            name="numero_protocolo"
            value={ordem.numero_protocolo}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Nome do Solicitante:</label>
          <input
            type="text"
            name="nome_solicitante"
            value={ordem.nome_solicitante}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Telefone do Solicitante:</label>
          <input
            type="text"
            name="telefone_solicitante"
            value={ordem.telefone_solicitante}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Data de Abertura:</label>
          <input
            type="date"
            name="data_abertura"
            value={ordem.data_abertura}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Data de Agendamento:</label>
          <input
            type="date"
            name="data_agendamento"
            value={ordem.data_agendamento}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Descrição do Serviço:</label>
          <textarea
            name="descricao_servico"
            value={ordem.descricao_servico}
            onChange={handleChange}
          ></textarea>
        </div>
        <div>
          <label>Tipo de Visita:</label>
          <select
            name="tipo_visita"
            value={ordem.tipo_visita}
            onChange={handleChange}
          >
            <option value="Técnico">Técnico</option>
            <option value="Científico">Científico</option>
          </select>
        </div>
        <div>
          <label>Modalidade:</label>
          <select
            name="modalidade"
            value={ordem.modalidade}
            onChange={handleChange}
          >
            <option value="Presencial">Presencial</option>
            <option value="Remoto">Remoto</option>
          </select>
        </div>
        <div>
          <label>Nome da Empresa:</label>
          <input
            type="text"
            name="nome_empresa"
            value={ordem.nome_empresa}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Endereço:</label>
          <input
            type="text"
            name="endereco"
            value={ordem.endereco}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Problema Reportado:</label>
          <textarea
            name="problema_reportado"
            value={ordem.problema_reportado}
            onChange={handleChange}
          ></textarea>
        </div>
        <div>
          <label>Nome do Técnico:</label>
          <input
            type="text"
            name="nome_tecnico"
            value={ordem.nome_tecnico}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Status:</label>
          <select
            name="status"
            value={ordem.status}
            onChange={handleChange}
          >
            <option value="Aguardando Atendimento">Aguardando Atendimento</option>
            <option value="Em Pendência">Em Pendência</option>
            <option value="Realizado Em Validação">Realizado Em Validação</option>
            <option value="Finalizado">Finalizado</option>
            <option value="Atrasado">Atrasado</option>
          </select>
        </div>
        <button type="submit">Salvar Alterações</button>
      </form>
    </div>
  );
};

export default OrdemServicoEditar;
